import { ImageGalleryItem } from '../ImageGalleryItem/ImageGalleryItem';
import { Component } from 'react';

export class ImageGallery extends Component {
  state = {
    pictures: [],
    picture: null,
    isLoading: false,
    error: null,
  };

  render() {
    return (
      <ul className={css.ImageGallery}>
        <ImageGalleryItem items={pictures} />
      </ul>
    );
  }
}
